import styled from "styled-components";

const HeaderContainer = styled.div`
   position: relative;
   height: 800px;
   min-height: 500px;
   width: 100%;
   background: #161415 url(/landscape.jpg) no-repeat top center;
   background-size: cover !important;
	-webkit-background-size: cover !important;
   text-align: center;
   overflow: hidden;
`;

const Navbar = styled.nav`

`;


const Header = () => {

    return(
        <HeaderContainer>
            <Navbar>

            </Navbar>
        </HeaderContainer>
    )
}

export default Header;
